import numpy as np
from numpy.random import binomial

# Code adapted from https://github.com/ebuyakin/learning_past_tense

def default_activation(net, threshold=0.):
    if net > 0:
        return 1.
    else:
        return 0.


class Perceptron(object):
    
    def __init__(self, active=default_activation):
        self.W = None
        self.Theta = None
        self.activationFx = active
    
    def predict(self, X, **kwargs):
        net = np.dot(self.W, X)
        theta = self.Theta[:, np.newaxis]
        p = self.activationFx(net, theta=theta, **kwargs)
        y = binomial(1, p)
        return y
    
    
    def update_weights(self, X, Y, rate=0.0625, T=1.0):
        output = self.predict(X, T=T)
        
        for io in range(output.shape[1]):
            for i in range(self.W.shape[0]):
                if output[i, io] == 0 and Y[i, io] == 1:
                    for j in range(self.W.shape[0]):
                        if X[j, io] == 1:  # if input feature is 1 (so it matches the output)
                            self.W[i, j] += rate  # the weight is increased
                    self.Theta[i] -= rate  # and the threshold is decreased
                if output[i, io] == 1 and Y[i, io] == 0:
                    for j in range(self.W.shape[0]):
                        if X[j, io] == 1:  # if input feature is 1 (so it matches the output)
                            self.W[i, j] -= rate  # the weight is decreased
                    self.Theta[i] += rate  # and the threshold is increased
             
    
    def score(self, X, Y, T=1.0):
        # Returns the percent of correct output nodes
        output = self.predict(X, T=T)
        return np.sum(np.equal(output, Y), axis=0)/output.shape[0]
        
    def learn(self, X, Y, W=None, Theta=None, T=1.0, rate=0.5):
        n_features = X.shape[0]  # 460 (each feature is 1 wickelfeature detector)
        n_examples = X.shape[1]
        
        if W is not None: 
            self.W = W
        elif self.W is None:
            self.W = np.zeros((n_features, n_features))
        
        if Theta is not None:
            self.Theta = Theta
        elif self.Theta is None:
            self.Theta = np.zeros(n_features)
        
        self.update_weights(X, Y, rate=rate, T=T)
        return self.score(X, Y, T=T)
        

